import { FC } from "react";
import { WrapperVariables } from "./ExtraVariablesItem.styled";


const ExtraVariablesItem: FC<any> = ({item:any, id}) => {
    return (
        <WrapperVariables>

            <div key={id}>
                                <span>номер товара</span>
                                <input type="text" value={item.number} />
                                <span>номер цвета</span>
                                <input type="text" value={item.color} />
                                <span>количество</span>
                                <input type="text" value={item.count} />
                                <input type="file" />
                                <MainImage src={`http://localhost:5000/${item.image}`} alt="" />
                                <button>изменить фото</button>
                                <br />
                                <br />
                                <hr />
                            </div>

        </WrapperVariables>
    )
}

export default ExtraVariablesItem;
